import React from 'react';
import { FormGroup, Label, Input } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.css';

export default class IdPsp extends React.Component {
	render() {
		return (
			<div>
				<Label style={{ color: 'grey' }}>Identifiant(PSP)</Label>
				<Input
					type="text"
					name="PaiementNumber"
					id="PaiementNumber"
					maxLength="10"
					required
					value={this.props.idPsp}
				/>
				<p style={{ color: 'grey', textAlign: 'center' }}>Cet identifiant est absolument unique</p>
				<FormGroup />
			</div>
		);
	}
}
